         "cns": "\u8fde\u7eed\u5c06\u591a\u53d1\u5f13\u7bad\u96c6\u4e2d\u5c04\u5411\u4e00\u4e2a\u70b9\uff0c\u6709\u4e00\u5b9a\u51e0\u7387\u964d\u4f4e\u5bf9\u65b9\u547d\u4e2d\u3002",
