         "sw": "Powerful, downward strike. Lowers the defense of the target. Requires a two-handed weapon.",
         "th": "\u0e23\u0e27\u0e1a\u0e23\u0e27\u0e21\u0e1e\u0e25\u0e31\u0e07\u0e44\u0e27\u0e49\u0e17\u0e35\u0e48\u0e02\u0e27\u0e32\u0e19 \u0e41\u0e25\u0e49\u0e27\u0e42\u0e08\u0e21\u0e15\u0e35\u0e2d\u0e22\u0e48\u0e32\u0e07\u0e23\u0e38\u0e19\u0e41\u0e23\u0e07 \u0e40\u0e09\u0e1e\u0e32\u0e30\u0e02\u0e27\u0e32\u0e19 2 \u0e21\u0e37\u0e2d \u0e42\u0e08\u0e21\u0e15\u0e35\u0e43\u0e19\u0e04\u0e23\u0e31\u0e49\u0e07\u0e40\u0e14\u0e35\u0e22\u0e27",
         "tw": "\u8b93\u6575\u4eba\u53d7\u5230\u91cd\u5927\u50b7\u5bb3\u4e26\u964d\u4f4e\u9632\u79a6\u529b\uff0c\u9700\u8981\u96d9\u624b\u6b66\u5668",
