         "sp": "Golpea al enemigo con una bola de electricidad est\u00e1tica. Probabilidad de reducir la defensa del objetivo.",
         "sw": "Damages the enemy with a ball of static. Chance to reduce the targets defense.",
         "th": "\u0e2a\u0e23\u0e49\u0e32\u0e07\u0e04\u0e27\u0e32\u0e21\u0e40\u0e2a\u0e35\u0e22\u0e2b\u0e32\u0e22\u0e43\u0e2b\u0e49\u0e01\u0e31\u0e1a\u0e28\u0e31\u0e15\u0e23\u0e39\u0e14\u0e49\u0e27\u0e22\u0e25\u0e39\u0e01\u0e1a\u0e2d\u0e25\u0e44\u0e1f \u0e42\u0e2d\u0e01\u0e32\u0e2a\u0e43\u0e19\u0e01\u0e32\u0e23\u0e25\u0e14\u0e01\u0e32\u0e23\u0e1b\u0e49\u0e2d\u0e07\u0e01\u0e31\u0e19\u0e40\u0e1b\u0e49\u0e32\u0e2b\u0e21\u0e32\u0e22",
