         "sw": "Fully concentrated strike. Always Consumes 100% MP.",
         "th": "\u0e43\u0e0a\u0e49\u0e1e\u0e25\u0e31\u0e07 MP \u0e17\u0e35\u0e48\u0e21\u0e35\u0e2d\u0e22\u0e39\u0e48\u0e17\u0e31\u0e49\u0e07\u0e2b\u0e21\u0e14\u0e42\u0e08\u0e21\u0e15\u0e35",
