         "jp": "\u30a2\u30d0\u30e9\u30f3\u30c1",
         "kr": "\uc544\ubc14\ub780\uce58",
         "nl": "Sneeuwstorm",
         "pl": "Zamie\u0107",
         "ru": "\u0411\u0443\u0440\u0430\u043d",
